import { createBrowserRouter, useRouteError } from "react-router-dom";
import App from './App';

const router = createBrowserRouter([
  {
    element: <App />,
    children: [
      {
        path: "compose-salad",
        element: <ComposeSalad setSalads={setSalads} salads={salads}/>
      }
    ]
  },
]);
export default router;
